import React, {Component} from 'react';

import Image from 'react-bootstrap/Image';
import { Button, Navbar } from 'react-bootstrap';
import './navbar.css';
import { translate, Trans } from "react-i18next";


class Nav extends Component {

    render() {
      const { t, i18n } = this.props;

      const changeLanguage = lng => {
      console.log('in change lang', lng)
      i18n.changeLanguage(lng);
    };
    return (
        <div className="navbar__container">
          <button onClick={() => changeLanguage('jp')}>de</button>
          <button onClick={() => changeLanguage('en')}>en</button>
          <Navbar>
            <div className="navbar__links">
                <img src="/assets/logo-cci.svg" />
                <a href='/'>Beetroots</a>
                <a href='/'>Horseraddish</a>
                <a href='/'>Sea lettuce</a>
            </div>
            <div className="navbar__button">
                <Button variant="success">{ t('startBuilding', { framework: "react-i18next" }) }</Button>
            </div>
          </Navbar>
      </div>
    );
  } 
}

export default translate('common')(Nav);
